import React from 'react'
import styled from 'styled-components';
import SectionContainer from './styled/SectionContainer.styled'
import SectionMainHeading from './styled/SectionMainHeading.styled'
import SkillsMoreGrid from './styled/SkillsMoreGrid.styled'
import { GitHubSvg } from './styled/Icons.styled';

const ForMore = () => {
  return (
    <SectionContainer>
      <SectionMainHeading>For More</SectionMainHeading>
      <SkillsMoreGrid>
        <StyledIcon>
          <GitHubSvg />
        </StyledIcon>
        <StyledIcon>
          <GitHubSvg />
        </StyledIcon>
        <StyledIcon>
          <GitHubSvg />
        </StyledIcon>
      </SkillsMoreGrid>
    </SectionContainer>
  )
}

export default ForMore

const StyledIcon = styled.svg`
  background-color: var(--sub-color);
  border-radius: 50%;
  color: white;
  font-size: 2rem;
  text-align: center;
  width: 55px;
  height: 55px;
  margin-bottom: 0.5rem;
  padding: 12px 0;
`
